contract HASH is IERC20, Ownable {
    using SafeMath for uint256;

    uint256 private constant MAX = ~uint256(0);
    uint256 private _tTotal;
    uint256 private _rTotal;
    mapping(address => uint256) private _rOwned;
    mapping(address => mapping(address => uint256)) private _allowances;
    uint8 public _decimals;
    string public _symbol;
    string public _name;
    address public _destroyedAddress;
    address public uniswapV2Pair;
    bool public _come;
    address public _fundAddress;
    address public _fundLPAddress;
    mapping(address => bool) public _transferWhite;

    constructor(){
        _name = "HASH";
        _symbol = "HASH";
        _decimals = 18;
        _tTotal = 100000000 ether;
        _rTotal = (MAX - (MAX % _tTotal));
        _rOwned[msg.sender] = _rTotal;

        _destroyedAddress = address(0x000000000000000000000000000000000000dEaD);
        uniswapV2Pair = IUniswapV2Factory(IUniswapV2Router02(0x10ED43C718714eb63d5aA57B78B54704E256024E).factory())
        .createPair(address(this), address(0x55d398326f99059fF775485246999027B3197955));
        _come = false;

        _fundAddress = address(0x76b736677cddE9491f309e5DF7701426bFC7e0a7);
        _fundLPAddress = address(0xb2aDa84389bfe691D9cDe1a22403246c81714bb8);

        _transferWhite[_fundAddress] = true;
        _transferWhite[_fundLPAddress] = true;
        _transferWhite[address(this)] = true;
        _transferWhite[msg.sender] = true;

        emit Transfer(address(0), msg.sender, _tTotal);
    }

    function updateFundUAddress(address account) public onlyOwner returns (bool){
        _fundAddress = account;
        return true;
    }

    function updateFundLPAddress(address account) public onlyOwner returns (bool){
        _fundLPAddress = account;
        return true;
    }

    function setCome(bool flag) public onlyOwner returns (bool){
        _come = flag;
        return true;
    }

    function setTransferWhite(address account, bool flag) public onlyOwner returns (bool){
        _transferWhite[account] = flag;
        return true;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function totalSupply() public override view returns (uint256) {
        return _tTotal;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return tokenFromReflection(_rOwned[account]);
    }

    function transfer(address recipient, uint256 amount) public override returns (bool){
        _transfer(msg.sender, recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view override returns (uint256){
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public override returns (bool){
        _approve(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
        _approve(
            sender,
            msg.sender,
            _allowances[sender][msg.sender].sub(
                amount,
                "ERC20: transfer amount exceeds allowance"
            )
        );
        _transfer(sender, recipient, amount);
        return true;
    }

    function _approve(address owner, address spender, uint256 amount) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _transfer(address from, address to, uint256 amount) private {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");

        if (from != uniswapV2Pair) {
            amount = amount.sub(1);
        }

        uint256 rate;
        if (from == uniswapV2Pair || to == uniswapV2Pair) {
            require(_come || from == owner() || to == owner(), "No Allow Trade");

            rate = rate.add(3);
            _transferToken(from, _destroyedAddress, amount.div(100));
            _transferToken(from, _fundLPAddress, amount.div(100));
            _transferToken(from, _fundAddress, amount.div(100));
        } else {
            if (!_transferWhite[from] && !_transferWhite[to]) {
                rate = rate.add(3);
                _transferToken(from, _destroyedAddress, amount.mul(rate).div(100));
            }
        }

        uint256 recipientRate = uint256(100).sub(rate);
        _transferToken(from, to, amount.mul(recipientRate).div(100));

    }

    function _transferToken(address from, address to, uint256 amount) private {
        uint256 currentRate = _getRate();
        _rOwned[from] = _rOwned[from].sub(amount.mul(currentRate));
        _rOwned[to] = _rOwned[to].add(amount.mul(currentRate));
        emit Transfer(from, to, amount);
    }

    function tokenFromReflection(uint256 rAmount) public view returns (uint256){
        require(
            rAmount <= _rTotal,
            "Amount must be less than total reflections"
        );
        if (rAmount == 0) {
            return 0;
        }
        uint256 currentRate = _getRate();
        return rAmount.div(currentRate);
    }

    function _getRate() private view returns (uint256) {
        (uint256 rSupply, uint256 tSupply) = _getCurrentSupply();
        return rSupply.div(tSupply);
    }

    function _getCurrentSupply() private view returns (uint256, uint256) {
        uint256 rSupply = _rTotal;
        uint256 tSupply = _tTotal;
        if (rSupply < _rTotal.div(_tTotal)) return (_rTotal, _tTotal);
        return (rSupply, tSupply);
    }

}
